[{"location":"about/#About","page":"About","title":"About","text":"This page contains some general information about this project and recommendations about contributing.\n\nPages = [\"about.md\"]","category":"section"},{"location":"about/#Contributing","page":"About","title":"Contributing","text":"If you like this package, consider contributing!\n\nCreating an issue in the JuliaReachTemplatePkg GitHub issue tracker to report a bug, open a discussion about existing functionality, or suggest new functionality is appreciated.\n\nIf you have written code and would like it to be peer reviewed and added to the library, you can fork the repository and send a pull request (see below).\n\nYou are also welcome to get in touch with us in the JuliaReach Zulip channel.\n\nBelow we give some general comments about contributing to this package. The JuliaReach development documentation describes coding guidelines; take a look when in doubt about the coding style that is expected for the code that is finally merged into the library.","category":"section"},{"location":"about/#Branches-and-pull-requests-(PR)","page":"About","title":"Branches and pull requests (PR)","text":"We use a standard pull-request policy: You work in a private branch and eventually add a pull request, which is then reviewed by other programmers and merged into the master branch.\n\nEach pull request should be based on a branch with the name of the author followed by a descriptive name, e.g., mforets/my_feature. If the branch is associated to a previous discussion in an issue, we use the number of the issue for easier lookup, e.g., mforets/7.","category":"section"},{"location":"about/#Unit-testing-and-continuous-integration-(CI)","page":"About","title":"Unit testing and continuous integration (CI)","text":"This project is synchronized with GitHub Actions such that each PR gets tested before merging (and the build is automatically triggered after each new commit). For the maintainability of this project, it is important to make all unit tests pass.\n\nTo run the unit tests locally, you can do:\n\njulia> using Pkg\n\njulia> Pkg.test(\"JuliaReachTemplatePkg\")\n\nWe also advise adding new unit tests when adding new features to ensure long-term support of your contributions.","category":"section"},{"location":"about/#Contributing-to-the-documentation","page":"About","title":"Contributing to the documentation","text":"New functions and types should be documented according to the JuliaReach development documentation.\n\nYou can view the source-code documentation from inside the REPL by typing ? followed by the name of the type or function.\n\nThe documentation you are currently reading is written in Markdown, and it relies on the package Documenter.jl to produce the final layout. The sources for creating this documentation are found in docs/src. You can easily include the documentation that you wrote for your functions or types there (see the source code or Documenter's guide for examples).\n\nTo generate the documentation locally, run docs/make.jl, e.g., by executing the following command in the terminal:\n\n$ julia --color=yes docs/make.jl","category":"section"},{"location":"about/#Credits","page":"About","title":"Credits","text":"Here we list the names of the maintainers of the JuliaReachTemplatePkg.jl library, as well as past and present contributors (in alphabetic order).","category":"section"},{"location":"about/#Core-developers","page":"About","title":"Core developers","text":"Marcelo Forets, Universidad de la Rep√∫blica\nChristian Schilling, Aalborg University","category":"section"},{"location":"#JuliaReachTemplatePkg.jl","page":"Home","title":"JuliaReachTemplatePkg.jl","text":"JuliaReachTemplatePkg is a Julia template package for the JuliaReach ecosystem.","category":"section"},{"location":"#Library-Outline","page":"Home","title":"Library Outline","text":"Pages = [\n]\nDepth = 2","category":"section"}]
